  const { name } = user;

  return (
    <div>
      <nav className='navbar navbar-dark bg-dark'>
        <Link to='/'>
          <i className='material-icons md-48 nav-icon-position'>
            account_balance
          </i>
        </Link>

        <h2 className='nav-text head-text-position'>Bank App</h2>
        <div className=''>
